import { Container, Row, Col } from 'react-bootstrap';
import imgRightBottom from '../img/img-right-bottom.jpg';
import imgRightTop from '../img/img-right-top.jpg';
import imgLeft from '../img/img-left.jpg';

function About() {
  return (
	<Container className="pt-5 pb-5 mt-5 mb-5">
    <div className="row align-items-center">
        <div className="col-lg-6 col-md-6 col-12 order-1 order-md-2">
            <div className="section-title ml-lg-5">
                <div className = "card text-white bg-primary border-primary container-services-shadow">
                <div className='card-body'>
                    <h1 className="title mb-4">
						About Us
                   </h1>
					<p>With over 20 years experience with residential and commercial cleaning, we offer free quotes with the most competitive prices in town. We offer only the best exceptional cleaning services to make your life easier!</p>
					<p>Contact us today for some clean peace of mind.</p>
                </div>
                </div>
            </div>
        </div>

		<div className="col-lg-6 col-md-6 order-2 order-md-1 mt-4 pt-2 mt-sm-0 opt-sm-0">
        </div>
    </div>
    </Container>
  );
}

export default About;
